  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0145840 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR1509 in the
  South Pacific Ocean from 2015-06-20 to 2015-06-30. These data include CURRENT SPEED
  - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
  used to collect these data include ADCP and GPS. These data were collected by Laura
  Wallace of University of Texas; University of Texas - Austin; Institute for Geophysics,
  and by University of California - San Diego; Scripps Institution of Oceanography
  as part of Hikurangi Ocean Bottom Investigation of Tremor and Slow Slip (HOBITSS).
  The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI as part
  of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
  the raw and automated processed data set. Post processed quality assessed data are
  not available in this accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
